    equotient:MonStgElt,    // small group label N.i of K/H when H is normal in K = intersection of ell-adic projections of H
    mintwist:MonStgElt,     // minimal label (accoring to GL2CompareLabels) of a subgroup of GL2(Zhat) with the same sl2label
    model:MonStgElt,        // for genus one curves whose Jacobian has positive rank this is the Cremona label of an elliptic curve isomorphic to X_H, must be externally computed
    jmap:RngElt,            // for H containing -I if X_H(Q) is infinite jmap:X_H->X(1) is an element of Q(t) (genus 0) or of Q(y)(x) (genus 1), must be externally computed
    Emap:SeqEnum,           // for genus zero H not containing -I with X_H(Q) infinite a pair [A(t),B(t)] defining the universal E:y^2=x^3+A(t)x+B(t), must be externally computed
    sset:Assoc,             // set of similarity invariants identifying the conjugacy classes in H (only set when requested, never saved)
    secs:FldReElt           // total time spent working on this group
>;

function types(rec)
    assert Type(rec) eq RecFrmt;
    s := sprint(rec);  assert s[1..10] eq "recformat<" and s[#s] eq ">"; s := s[11..#s-1];
    T := AssociativeArray();
    for t in Split(s,",") do a := Split(t,":"); T[a[1]] := eval(a[2]); end for;
    return T;
end function;

colindexes := func<header,cols|[Index(header,c):c in cols]>;

gl2cols := Names(gl2rec);
gl2colindex := func<s|Index(gl2cols,s)>;
gl2colindexes := func<cols|colindexes(gl2cols,cols)>;
gl2coltypes := types(gl2rec);
gl2xcols := ["subgroup","proved","model","jmap","Emap","sset"];
gl2datacols := [s:s in gl2cols|not s in gl2xcols]; // cols created by GL2LatticeData

rstr := func<s|s>;
rbool := func<s|s eq "1">;
rsub := func<s|sub<GL(2,Rationals())|atoiii(s)>>; // We set the level after parsing
rgdata := func<s|s[1] eq "[" select atoii(s) else [atoi(s)]>; // for backward compatibility (cusps was replaced by gdata)
rgclass := func<s|s[1] eq "[" select labels(s)[1] else s>; // for backward compatibility (gclass is now part of the label)
Ft<t> := FunctionField(Rationals()); Fx<x> := FunctionField(Rationals()); Fy<y> := FunctionField(Fx);
rjmap := func<s|eval(s)>;
rEmap := func<s|eval(s)>;

gl2goncols := ["label", "index", "parents", "qenus", "gons"]; // cols needed by GL2GonalityTable
gl2igoncols := gl2colindexes(gl2goncols);
gl2latcols := ["label", "gens", "parents"]; // created for both fine and coarse groups by GL2Lattice
gl2ilatcols := gl2colindexes(gl2latcols);
gl2clatcols := ["label", "key", "gens", "gdata", "cdata", "parents", "parents_conj"]; // created for coarse groups by GL2Lattice
gl2iclatcols := gl2colindexes(gl2clatcols);
gl2idatacols := gl2colindexes(gl2datacols);

gl2readers := [*
    <"gens",atoiii>, <"subgroup",rsub>, <"level",atoi>, <"rlevel",atoi>, <"index",atoi>, <"dindex",atoi>, <"rindex",atoi>, <"genus",atoi>, <"gdata",rgdata>, <"cdata",atoiii>, <"cgdata",atoiii>,
    <"sl2level",atoi>, <"ratcusps",atoi>, <"negone",rbool>, <"parents",labels>, <"parents_conj",atoiii>, <"children",labels>, <"reductions",labels>, <"factors",labels>, <"CPlabels",labels>,
    <"orbits",atoiii>, <"korbits",atoiii>, <"iorbits",atoiii>, <"ghash",atoi>, <"gclass",rgclass>, <"obstructions",atoii>, <"cmdiscs",atoii>, <"newforms",labels>, <"dims",atoii>,
    <"stdgens",atoiii>, <"stdconj",atoii>, <"mults",atoii>, <"rank",atoi>, <"cond",atoiii>, <"traces",atoii>, <"thash",atoi>, <"gons",atoii>, <"key",atoi>, <"proved",rbool>,
    <"refinable",rbool>, <"agreeable",rbool>, <"aquotient",atoii>, <"comindex",atoi>, <"eindex",atoi>, <"jmap",rjmap>, <"Emap",rEmap>, <"secs",atof>
*];
gl2readers := IndexFibers(gl2readers,func<r|r[1]>:Unique,Project:=func<r|r[2]>); // default is copy string
gl2readers := [* IsDefined(gl2readers,s) select gl2readers[s] else rstr : s in gl2cols *];

wbool := func<x|x select "1" else "0">;
wsub := func<x|gstr(x)>;

gl2writers := [ <"subgroup",wsub>, <"negone", wbool>, <"proved", wbool>, <"refinable", wbool>, <"agreeable", wbool> ]; // default is sprint
gl2writers := IndexFibers(gl2writers,func<r|r[1]>:Unique,Project:=func<r|r[2]>);
gl2writers := [* IsDefined(gl2writers,s) select gl2writers[s] else sprint : s in gl2cols *];

intrinsic GL2RecToString(r::Rec:cols:=gl2idatacols) -> MonStgElt
{ Serializes gl2rec r to a string that can be used to reconstruct r via GL2RecFromString. }
    return coljoin([assigned r``s select gl2writers[i](r``s) else "" where s:=gl2cols[i]: i in cols]);
end intrinsic;

intrinsic GL2RecFromString(s::MonStgElt:icols:=gl2idatacols,ocols:=[1..#icols]) -> Rec
{ Recreates gl2rec from serialized string created by GL2RecToString, icols should be a list of indices into Names(gl2rec) specifying the columns of s (in order), ocols is a list of indices into icols indicating the columns to be extracted (typically all of them). }
    r := rec<gl2rec|>;
    colvals := colsplit(s); assert #colvals eq #icols;
    for i in ocols do j := icols[i]; if #colvals[i] gt 0 then r``(gl2cols[j]) := gl2readers[j](colvals[i]); end if; end for;
    r`subgroup := GL2FromGenerators(r`level,r`index,r`negone,r`gens);
    return r;
end intrinsic;

intrinsic GL2CompareRSZBLabels(a::MonStgElt,b::MonStgElt) -> RngIntElt
{ Lexicographically compares subgroup labels of the form N.i.g.n or N.i.g.d.n (N=level, i=index, g=genus, d=determinant index, n=ordinal) as lists of integers.  Returns -1,0,1. }
    if a eq b then return 0; end if; if a eq "?" then return 1; end if; if b eq "?" then return -1; end if;
    if "-" in a or "-" in b then
        aa := "-" in a select Split(a,"-") else ["1.1.1",a];  bb := "-" in b select Split(b,"-") else ["1.1.1",b];
        if aa[1] ne bb[1] then return GL1CompareLabels(aa[1],bb[1]); end if;
        a := aa[2]; b := bb[2];
    end if;
    r := [atoi(x):x in Split(a,".")]; s := [atoi(x):x in Split(b,".")];
    require #r eq 4 and #s eq 4: "Invalid subgroup label";
    return r lt s select -1 else 1;
end intrinsic;

intrinsic GL2CompareLMFDBLabels(a::MonStgElt,b::MonStgElt) -> RngIntElt
{ Lexicographically compares subgroup labels of the form N.i.g.c.n (N=level, i=index, g=genus, c=gclass (basse26), n=num) or N.i.g-M.c.m.n  (N=fine-level, i=fine-index, g=genus, M=coarse-level, c=coarse-gclass (basse26), m=coarse-num, n=fine-num). }
    if a eq b then return 0; end if; if a eq "?" then return 1; end if; if b eq "?" then return -1; end if;
    x := Split(a,"."); y := Split(b,".");
    if x[1] ne y[1] then return atoi(x[1]) - atoi(y[1]); end if;
    if x[2] ne y[2] then return atoi(x[2]) - atoi(y[2]); end if;
    if "-" in x[3] or "-" in y[3] then
        if "-" in x[3] then xx := Split(x[3],"-") cat x[4..6]; else xx := [x[3],x[1],x[4],x[5],"0"]; end if;
        if "-" in y[3] then yy := Split(y[3],"-") cat y[4..6]; else yy := [y[3],y[1],y[4],y[5],"0"]; end if;
        if xx[1] ne yy[1] then return atoi(xx[1]) - atoi(yy[1]); end if;
        if xx[2] ne yy[2] then return atoi(xx[2]) - atoi(yy[2]); end if;
        if xx[3] ne yy[3] then return Base26Decode(xx[3])-Base26Decode(yy[3]); end if;
        if xx[4] ne yy[4] then return atoi(xx[4]) - atoi(yy[4]); end if;
        return atoi(xx[5]) - atoi(yy[5]);
    end if;
    if x[3] ne y[3] then return atoi(x[3]) - atoi(y[3]); end if;
    if x[4] ne y[4] then return Base26Decode(x[4])-Base26Decode(y[4]); end if;
    return atoi(x[5])-atoi(y[5]);
end intrinsic;

intrinsic GL2CoarseLabel(finelabel::MonStgElt) -> MonStgElt
{ Given the fine label of a subgroup H not containing -I returns the coarse label of the subgroup <H,-I>. }
    if not "-" in finelabel then return finelabel; end if;
    return Join([l2[1],istr(atoi(l1[2]) div 2),l1[3],l2[2],l2[3]],".") where l1 := Split(ll[1],".") where l2 := Split(ll[2],".") where ll := Split(finelabel,"-");
end intrinsic;

intrinsic GL2SortRSZBLabels(L::SeqEnum[MonStgElt]) -> SeqEnum[MonStgElt]
{ Sorts the specified list of labels of subgroups of GL(2,Zhat). }
    L := Sort(L,func<a,b|GL2CompareRSZBLabels(a,b)>);
    return L;
end intrinsic;

intrinsic GL2SortLMFDBLabels(L::SeqEnum[MonStgElt]) -> SeqEnum[MonStgElt]
{ Sorts the specified list of labels of subgroups of GL(2,Zhat). }
