intrinsic GL2SortLabels(L::SeqEnum[MonStgElt]) -> SeqEnum[MonStgElt]
{ Sorts the specified list of labels of subgroups of GL(2,Zhat). }
    if #L eq 0 then return L; end if;
    L := #Split(L[1],".") eq 4 select Sort(L,func<a,b|GL2CompareRSZBLabels(a,b)>) else Sort(L,func<a,b|GL2CompareLMFDBLabels(a,b)>);
    return L;
end intrinsic;

intrinsic GL2MinRSZBLabel(L::SeqEnum[MonStgElt]) -> MonStgElt
{ Least label in the specified list of labels of subgroups of GL(2,Zhat). }
    require #L gt 0: "List of labels must nonempty";
    k := L[1];
    for i:=2 to #L do if GL2CompareRSZBLabels(L[i],k) lt 0 then k := L[i]; end if; end for;;
    return k;
end intrinsic;

