intrinsic GL2Save(filename::MonStgElt,X::.:cols:=gl2idatacols,L:=Keys(X),header:=true)
{ Given an enumerable object X containing gl2recs, serializes the elements of X and writes them to the specified file. }
    fp := Open(filename, "w");
    if header then name := Names(gl2rec); Puts(fp,coljoin(gl2cols[cols])); end if;
    for k in L do Puts(fp,GL2RecToString(X[k]:cols:=cols)); end for;
    Flush(fp);
end intrinsic;

intrinsic GL2Load(filename::MonStgElt : cols:=gl2idatacols,X:=AssociativeArray(),N:=0,IndexLimit:=0) -> Assoc, Assoc
{ Loads a list of serialized gl2recs from the specified file and returns an associative array indexed by label that contains them, and optional an associative array indexed by GL2SubgroupKey values that can be used to efficiently lookup labels. }
    S := Split(Read(filename));
    r := colsplit(S[1]);
    if r eq gl2latcols or r eq gl2clatcols then return GL2LoadLattice(filename:X:=X,N:=N,IndexLimit:=IndexLimit); end if;
    if isalpha(S[1][1]) then j := 2; icols := gl2colindexes(r); else j := 1; icols := [i:i in [1..#r]]; end if;
    if not Set(cols) subset Set(icols) then printf "GL2Load Warning: the requested columns %o are not present in %o.\n", [gl2cols[i]:i in Set(cols) diff Set(icols)], filename; end if;
    ocols := [Index(icols,i):i in cols]; ocols := [i:i in ocols|i gt 0];
    if N gt 0 or IndexLimit gt 0 then assert icols[1] eq 1; end if;
    if N gt 0 then
        if IndexLimit gt 0 then
            for i:=j to #S do s := Split(S[i][1..32],"."); if atoi(s[1]) eq N and atoi(s[2]) le IndexLimit then
                r:=GL2RecFromString(S[i]:icols:=icols,ocols:=ocols); X[r`label] := r;
            end if; end for;
        else
            for i:=j to #S do if atoi(Split(S[i][1..32],".")[1]) eq N then
                r:=GL2RecFromString(S[i]:icols:=icols,ocols:=ocols); X[r`label] := r;
            end if; end for;
        end if;
    else
        if IndexLimit gt 0 then
            for i:=j to #S do if atoi(Split(S[i][1..32],".")[2]) le IndexLimit then
                r:=GL2RecFromString(S[i]:icols:=icols,ocols:=ocols); X[r`label] := r;
            end if; end for;
        else
            for i:=j to #S do r:=GL2RecFromString(S[i]:icols:=icols,ocols:=ocols); X[r`label] := r; end for;
        end if;
    end if;
    return X;
end intrinsic;

intrinsic GL2LoadLattice(filename::MonStgElt : X:=AssociativeArray(), Z:=AssociativeArray(), N:=0, fineN:=0, IndexLimit:=0, GenusLimit:=-1, lookup:=false, sl2:=false) -> Assoc, Assoc
{ Loads a list of serialized gl2recs from the specified file and returns an associative array indexed by label that contains them. }
    S := Split(Read(filename));
    require #S gt 0: Sprintf("The input file %o is empty\n",filename);
    r := colsplit(S[1]);
    label := Index(r,"label"); gens := Index(r,"gens"); if gens eq 0 then gens := Index(r,"subgroup"); end if; parents := Index(r,"parents");
    require label gt 0 and gens gt 0 and parents gt 0: "Missing required columns label, gens/subgroup, parents";
    key := Index(r,"key"); gdata := Index(r,"gdata"); cdata := Index(r,"cdata"); parents_conj := Index(r,"parents_conj"); if parents_conj eq 0 then parents_conj := Index(r,"conjugators"); end if;
    fromgens := sl2 select SL2FromGenerators else GL2FromGenerators;
    if lookup then require key: "Missing column key needed to create lookuptable."; end if;
    for i:=2 to #S do
        r := colsplit(S[i]); l := Split(r[label],"."); assert #l ge 5; l := l[1..3];
        if "-" in l[3] then negone := false; l[3] := Split(l[3],"-")[1]; else negone := true; end if;
        if N gt 0 and atoi(l[1]) ne N then continue; end if;
        if fineN gt 0 and not negone and atoi(l[1]) ne fineN then continue; end if;
        if IndexLimit gt 0 and atoi(l[2]) gt (negone select 1 else 2)*IndexLimit then continue; end if;
        if GenusLimit gt -1 and atoi(l[3]) gt GenusLimit then continue; end if;
        z := rec<gl2rec|label:=r[label],level:=level,index:=index,subgroup:=fromgens(level,index,genus,negone,gens),gens:=gens,genus:=genus,negone:=negone,parents:=labels(r[parents])>
                        where level := atoi(l[1]) where index := atoi(l[2]) where genus := atoi(l[3]) where gens := atoiii(r[gens]);
        if key gt 0 then z`key := atoi(r[key]); end if;
        if gdata gt 0 then z`gdata := atoii(r[gdata]); end if;
        if cdata gt 0 then z`cdata := atoiii(r[cdata]); end if;
        if parents_conj gt 0 then z`parents_conj := atoiii(r[parents_conj]); end if;
        X[z`label] := z;
    end for;
    if lookup then Z:=GL2LookupTable(X); return X,Z; end if;
    return X;
end intrinsic;

intrinsic SL2LoadLattice(filename::MonStgElt : X:=AssociativeArray(), Z:=AssociativeArray(), IndexLimit:=0, lookup:=false) -> Assoc, Assoc
{ Loads a list of serialized gl2recs from the specified file and returns an associative array indexed by label that contains them. }
    return GL2LoadLattice (filename : X:=X, Z:=Z, IndexLimit:=IndexLimit, lookup:=lookup, sl2);
end intrinsic;

function gl2keytab(inrecs : Z:=AssociativeArray(), N:=0, sl2:=false, makegroups:=false, labelcol:="label")
    if sl2 then if not assigned Z`SL and #Z gt 0 then error "GL2/SL2 mismatch"; end if;
    else if assigned Z`SL then error "SL2/GL2 mismatch"; end if; end if;
    r := colsplit(inrecs[1]);
    labelcol := Index(r,labelcol); keycol := Index(r,"key"); genscol := Index(r,"gens"); if genscol eq 0 then genscol := Index(r,"subgroup"); end if;
    assert labelcol ne 0 and keycol ne 0 and genscol ne 0;
    Nstr := istr(N);
    makeval := makegroups select (sl2 select func<k,l,i,g|<k,SL2FromGenerators(l,i,g)>> else func<k,l,i,g|<k,GL2FromGenerators(l,i,g)>>) else func<k,l,i,g|[k,l,i,g]>;
    for i:=2 to #inrecs do
        r := colsplit(inrecs[i]); l := Split(r[labelcol],".");
        if N ne 0 and l[1] ne Nstr then continue; end if;
        k := atoi(r[keycol]); Z[k] := Append(getval(Z,k),makeval(r[labelcol],l[1],l[2],r[genscol]));
        if makegroups then
            Z[k][#Z[k]][2]`Genus := Split(l[3],"-")[1];
            if #l eq 5 then Z[k][#Z[k]][2]`NegOne := true; elif #l gt 5 then Z[k][#Z[k]][2]`NegOne := false; end if;
        end if;
    end for;
    if sl2 and #Z gt 0 then Z`SL := true; end if;
    return Z;
end function;

intrinsic GL2LookupTable(filename::MonStgElt : Z:=AssociativeArray(Integers()), N:=0, makegroups:=false, labelcol:="label") -> Assoc
{ Loads subgroup keys and labels and returns an index to support lookup by label. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    return gl2keytab(Split(Read(filename)):Z:=Z,N:=N,makegroups:=makegroups,labelcol:=labelcol);
end intrinsic;

intrinsic GL2LookupTable(X::Assoc : Z:=AssociativeArray(Integers()), N:=0, makegroups:=false) -> Assoc
{ Creates index to support lookup by label. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    require #Z eq 0 or not assigned Z`SL: "SL2/GL2 mismatch"; delete Z`SL;
    for r in X do val := <r`label,r`subgroup>; if N eq 0 or r`level eq N then Z[r`key] := Append(getval(Z,r`key),val); end if; end for;
    return Z;
end intrinsic;

intrinsic SL2LookupTable(filename::MonStgElt : Z:=AssociativeArray(Integers()), N:=0, makegroups:=false) -> Assoc
{ Loads subgroup keys and labels and returns and index to support lookup by label. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    return gl2keytab(Split(Read(filename)):Z:=Z,N:=N,sl2,makegroups:=makegroups);
end intrinsic;

intrinsic SL2LookupTable(X::Assoc : Z:=AssociativeArray(Integers()), N:=0) -> Assoc
{ Creates index to support lookup by label. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    if #Z gt 0 then require assigned Z`SL: "GL2/SL2 mismatch"; end if;
    for r in X do val := <r`label,r`subgroup>; if N eq 0 or r`level eq N then Z[r`key] := Append(getval(Z,r`key),val); end if; end for;
    if #Z gt 0 then Z`SL := true; end if;
    return Z;
end intrinsic;

function gl2finetab(inrecs : Z:=AssociativeArray(), N:=0, sl2:=false, makegroups:=false)
    if sl2 then if not assigned Z`SL and #Z gt 0 then error "GL2/SL2 mismatch"; end if;
    else if assigned Z`SL then error "SL2/GL2 mismatch"; end if; end if;
    r := colsplit(inrecs[1]);
    labelcol := Index(r,"label"); genscol := Index(r,"gens");
    assert labelcol ne 0 and genscol ne 0;
    Nstr := istr(N);
    makeval := makegroups select (sl2 select func<k,l,i,g|<k,SL2FromGenerators(l,i,g)>> else func<k,l,i,g|<k,GL2FromGenerators(l,i,g)>>) else func<k,l,i,g|[k,l,i,g]>;
    for i:=2 to #inrecs do
        r := colsplit(inrecs[i]); l := Split(r[labelcol],".");
        if N ne 0 and l[1] ne Nstr then continue; end if;
        k := GL2CoarseLabel(r[labelcol]);
        Z[k] := Append(getval(Z,k),makeval(r[labelcol],l[1],l[2],r[genscol]));
        if makegroups then
            Z[k][#Z[k]][2]`Genus := Split(l[3],"-")[1];
            if #l eq 5 then Z[k][#Z[k]][2]`NegOne := true; elif #l gt 5 then Z[k][#Z[k]][2]`NegOne := false; end if;
        end if;
    end for;
    if sl2 and #Z gt 0 then Z`SL := true; end if;
    return Z;
end function;

intrinsic GL2LookupTable(coarsefile::MonStgElt, finefile::MonStgElt : Z:=<AssociativeArray(),AssociativeArray()>, N:=0, makegroups:=false) -> Tup
{ Creates lookup table that supports both coarse and fine groups. }
    return <gl2keytab(Split(Read(coarsefile)):Z:=Z[1],N:=N,makegroups:=makegroups),gl2finetab(Split(Read(finefile)):Z:=Z[2],N:=N,makegroups:=makegroups)>;
end intrinsic;

intrinsic SL2LookupTable(coarsefile::MonStgElt, finefile::MonStgElt : Z:=<AssociativeArray(),AssociativeArray()>, N:=0, makegroups:=false) -> Tup
{ Creates lookup table that supports both coarse and fine groups. }
    return <gl2keytab(Split(Read(coarsefile)):Z:=Z[1],N:=N,sl2,makegroups:=makegroups),gl2finetab(Split(Read(finefile)):Z:=Z[2],N:=N,sl2,makegroups:=makegroups)>;
end intrinsic;

intrinsic GL2LabelTable(Z::Assoc : ZL:=AssociativeArray(), N:=0) -> Assoc
{ Given a subgroup lookup table (mapping subgroups to labels) returns the a lookup table mapping labels to subgroups. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    require not assigned Z`SL and (#ZL eq 0 or not assigned ZL`SL): "SL2/GL2 mismatch"; delete ZL`SL;
    if Type(Random(Z)[1]) eq SeqEnum then
        Nstr := istr(N);
        for s in Z do for r in s do if N eq 0 or r[2] eq Nstr then ZL[r[1]] := r[2..4]; end if; end for; end for;
    else
        for s in Z do for r in s do if N eq 0 or r`Level eq N then ZL[r[1]] := r[2]; end if; end for; end for;
    end if;
    return ZL;
end intrinsic;

intrinsic SL2LabelTable(Z::Assoc : ZL:=AssociativeArray(), N:=0) -> Assoc
{ Given a subgroup lookup table (mapping subgroups to labels) returns the a lookup table mapping labels to subgroups. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    require assigned Z`SL and (#ZL eq 0 or assigned ZL`SL): "SL2/GL2 mismatch";
    if Type(Random(Z)[1]) eq SeqEnum then
        Nstr := istr(N);
        for s in Z do for r in s do if N eq 0 or r[2] eq Nstr then ZL[r[1]] := r[2..4]; end if; end for; end for;
    else
        for s in Z do for r in s do if N eq 0 or r`Level eq N then ZL[r[1]] := r[2]; end if; end for; end for;
    end if;
    if #ZL gt 0 then ZL`SL := true; end if;
    return ZL;
end intrinsic;

function gl2labeltab(inrecs : ZL:=AssociativeArray(), N:=0, sl2:=false, makegroups:=false)
    if sl2 then if not assigned ZL`SL and #ZL gt 0 then error "GL2/SL2 mismatch"; end if; else if assigned ZL`SL then error "GL2/SL2 mismatch"; end if; end if;
    r := colsplit(inrecs[1]);
    labelcol := Index(r,"label"); genscol := Index(r,"gens"); if genscol eq 0 then genscol := Index(r,"subgroup"); end if;
    assert labelcol ne 0 and genscol ne 0;
    Nstr := istr(N);
    makeval := makegroups select (sl2 select func<l,i,g|SL2FromGenerators(l,i,g)> else func<l,i,g|GL2FromGenerators(l,i,g)>) else func<l,i,g|[l,i,g]>;
    for i:=2 to #inrecs do
        r := colsplit(inrecs[i]); l := Split(r[labelcol],".");
        if N ne 0 and l[1] ne Nstr then continue; end if;
        ZL[r[labelcol]] := makeval(l[1],l[2],r[genscol]);
    end for;
    if sl2 and #ZL gt 0 then ZL`SL := true; end if;
    return ZL;
end function;

intrinsic GL2LabelTable(filename::MonStgElt : ZL:=AssociativeArray(), N:=0, makegroups:=false) -> Assoc
{ Returns a lookup table mapping labels to subgroups. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    return gl2labeltab(Split(Read(filename)):ZL:=ZL,N:=N,makegroups:=makegroups);
end intrinsic;

intrinsic GL2LookupGroup(ZL::Assoc, k::MonStgElt) -> GrpMat
{ Constructs the group with the specified label from the specified lookup table. }
    b,r := IsDefined(ZL,k);
    require b: "The specified label is not present in the specified lookup table: " cat k;
    return Type(r) eq SeqEnum select GL2FromGenerators(r[1],r[2],r[3]) else r;
end intrinsic;

intrinsic SL2LabelTable(filename::MonStgElt : ZL:=AssociativeArray(), N:=0, makegroups:=false) -> Assoc
{ Returns a lookup table mapping labels to subgroups. Set the optional parameter N to a nonzero value to restrict to subgroups of level N. }
    return gl2labeltab(Split(Read(filename)):ZL:=ZL,N:=N,sl2,makegroups:=makegroups);
end intrinsic;

intrinsic SL2LookupGroup(ZL::Assoc, k::MonStgElt) -> GrpMat
{ Constructs the group with the specified label from the specified lookup table. }
    b,r := IsDefined(ZL,k);
