    return Type(r) eq SeqEnum select SL2FromGenerators(r[1],r[2],r[3]) else r;
end intrinsic;

intrinsic GL2LookupLabel(Z::Assoc, H::GrpMat : NotFound:="?") -> MonStgElt, GrpMatElt
{ The label of the specified coarse subgroup of GL(2,Z/NZ) if it is present in the specified subgroup lattice (up to conjugacy). }
    require not assigned H`SL: "Subgroup should not be marked as a subgroup of SL2, use SL2LookupLabel or unassign H`SL.";
    require not assigned Z`SL: "Lookup table X has SL flag set but H does not.";
    if #Z eq 0 then return NotFound,_; end if;
    N,H := GL2Level(H);
    k := GL2SubgroupKey(H);
    G := GL2Ambient(N);
    if Type(Random(Z)[1]) eq SeqEnum then
        filter := func<S|[r:r in S|r[2] eq Nstr]> where Nstr:=istr(N);
        isconj := func<H,r|IsConjugate(G,H,GL2FromGenerators(r[2],r[3],r[4]))>;
    else
        filter := func<S|[r:r in S|#BaseRing(r[2]) eq N]>;
        isconj := func<H,r|IsConjugate(G,H,r[2])>;
    end if;
    b,S := IsDefined(Z,k); if not b then return NotFound,_; end if; S := filter(S); if #S eq 0 then return NotFound,_; end if;
    i := 0; repeat i +:= 1; b,c:=isconj(H,S[i]); until b or i eq #S;
    if not b then return NotFound,_; end if;
    return S[i][1],c;
end intrinsic;

intrinsic GL2LookupLabel(Z::Tup, H::GrpMat : NotFound:="?") -> MonStgElt
{ The label of the specified subgroup of GL(2,Z/NZ) if it is present in the specified subgroup lattice (up to conjugacy). }
    if GL2ContainsNegativeOne(H) then return GL2LookupLabel(Z[1], H: NotFound:=NotFound); end if;
    _,K := GL2Level(GL2IncludeNegativeOne(H));
    k,c := GL2LookupLabel(Z[1],K : NotFound:=NotFound);
    if k eq NotFound then return NotFound; end if;
    S := getval(Z[2],k);
    if #S eq 0 then return NotFound; end if;
    N,H := GL2Level(H); c := GL2ElementLifter(K`Level,N)(c); K := GL2Lift(K,N)^c; H := H^c;
    G := GL2Ambient(N); G:=Normalizer(G,K); // it is much cheaper to check conjugacy here!

    if Type(Random(Z[2])[1]) eq SeqEnum then
        filter := func<S|[r:r in S|r[2] eq Nstr]> where Nstr:=istr(N);
        grp := func<r|GL2FromGenerators(r[2],r[3],r[4])>;
    else
        filter := func<S|[r:r in S|#BaseRing(r[2]) eq N]>;
        grp := func<r|r[2]>;
    end if;
    S := filter(S); if #S eq 0 then return NotFound; end if;
    T := Conjugates(G,H);
    for i:=1 to #S do if grp(S[i]) in T then return S[i][1]; end if; end for;
    return NotFound;
    M := [i:i in [1..#S]|grp(S[i]) in T];  if #M eq 0 then return NotFound; end if; assert #M eq 1;
    return M[1];
end intrinsic;

intrinsic SL2LookupLabel(Z::Assoc, H::GrpMat : NotFound:="?") -> MonStgElt, GrpMatElt
{ The label of the specified subgroup of SL(2,Z/NZ) if it is present in the specified subgroup lattice (up to GL2-conjugacy). }
    require assigned H`SL: "Subgroup must be marked as a subgroup of SL2 (not just a subgroup of GL2 that happens to lie in SL2).";
    require assigned Z`SL: "Lookup table does not contain subgroups of SL2.";
    if #Z eq 0 then return NotFound,_; end if;
    N,H := SL2Level(H); Nstr := istr(N);
    k := SL2SubgroupKey(H);
    G := GL2Ambient(N); // we need to test GL2-conjugacy
    if Type(Random(Z)[1]) eq SeqEnum then
        filter := func<S|[r:r in S|r[2] eq Nstr]> where Nstr:=istr(N);
        isconj := func<H,r|IsConjugate(G,H,SL2FromGenerators(r[2],r[3],r[4]))>;
    else
        filter := func<S|[r:r in S|#BaseRing(r[2]) eq N]>;
        isconj := func<H,r|IsConjugate(G,H,r[2])>;
    end if;
    b,S := IsDefined(Z,k); if not b then return NotFound,_; end if; S := filter(S); if #S eq 0 then return NotFound,_; end if;
    i := 0; repeat i +:= 1; b,c:=isconj(H,S[i]); until b or i eq #S;
    if not b then return NotFound,_; end if;
    return S[i][1],c;
end intrinsic;

intrinsic SL2LookupLabel(Z::Tup, H::GrpMat : NotFound:="?") -> MonStgElt
{ The label of the specified subgroup of GL(2,Z/NZ) if it is present in the specified subgroup lattice (up to conjugacy). }
    if SL2ContainsNegativeOne(H) then return SL2LookupLabel(Z[1], H: NotFound :=NotFound); end if;
    _,K := SL2Level(SL2IncludeNegativeOne(H));
    k,c := SL2LookupLabel(Z[1],K : NotFound:=NotFound);
    if k eq NotFound then return NotFound; end if;
    S := getval(Z[2],k);
