    N,H := SL2Level(H); c := GL2ElementLifter(K`Level,N)(c); K := SL2Lift(K,N)^c; H := H^c;
    G := GL2Ambient(N); G:=Normalizer(G,K); // we need to test GL2-conjugacy
    if Type(Random(Z[2])[1]) eq SeqEnum then
