intrinsic GL2LMFDBData (coarsefile::MonStgElt, finefile::MonStgElt, lmfdbfile::MonStgElt, N::RngIntElt)
{ Given subgroup lattice data files coarsefile and finefile containing stringified gl2recs such that coarsefile contains the coarse group corresponding to every fine group
  in finefile (as identified by the clabel column), generates files in postgres format for upload to the table gps_gl2zhat (without headers). }
    timer := Realtime(); start := timer;
    coarsecnt := 0; finecnt := 0;
    X := AssociativeArray();
    inrecs := Split(Read(coarsefile));
    r := colsplit(inrecs[1]); assert isalpha(r[1]); icols := gl2colindexes(r);
    outfp := Open(lmfdbfile,"w");
    for i:=2 to #inrecs do
        r := GL2RecFromString(inrecs[i]:icols:=icols); if assigned r`negone then assert r`negone; else r`negone := true; end if;
        assert not IsDefined(X,r`label);
        X[r`label] := r;
        s := lmfdbrec(r,r);
        if r`level eq N then Puts(outfp,s);  coarsecnt +:= 1; end if;
    end for;
    Flush(outfp);
    if #finefile gt 0 then
        inrecs := Split(Read(finefile));
        for i:=2 to #inrecs do
            if atoi(Split(inrecs[i][1..32],".")[1]) eq N then
                r := GL2RecFromString(inrecs[i]:icols:=icols); if assigned r`negone then assert not r`negone; else r`negone := false; end if;
                Puts(outfp,lmfdbrec(r,X[r`clabel])); finecnt +:= 1;
            end if;
        end for;
        Flush(outfp);
    end if;
    vprintf GL2: "Output %o with %o+%o=%o records of LMFDB data created in %.3os\n", lmfdbfile, coarsecnt, finecnt, coarsecnt+finecnt, Realtime()-start;
end intrinsic;

intrinsic GL2LMFDBData(N::RngIntElt, jobs::RngIntElt : IndexLimit:=0, GenusLimit:=-1, header:=true)
{ Given subgroup lattice data files coarsefile and finefile containing stringifies gl2recs for coarse and fine groups, generates corresponding output file for upload to the LMFDB.}
    suffix := "_" cat istr(N); if IndexLimit gt 0 then suffix cat:= "_i" cat istr(IndexLimit); end if; if GenusLimit ge 0 then suffix cat:= "_g" cat istr(GenusLimit); end if; suffix cat:=".txt";
    coarsefile := "gl2cdat" cat suffix; finefile := "gl2fdat" cat suffix; lmfdbfile := "lmfdb" cat suffix;
    start := Realtime();
    s := Gets(Open(coarsefile,"r")); r := colsplit(s);
    clabelcol := Index(r,"clabel"); assert clabelcol gt 0;
    System(Sprintf("splitmod %o %o %o -%o 1 ; splitmod %o %o %o -%o 1 %o_map", coarsefile, coarsefile, jobs, clabelcol, finefile, finefile, jobs, clabelcol, coarsefile));
    ParallelJobs(Sprintf("GL2LMFDBData(\"%o_\" cat jobid, \"%o_\" cat jobid, \"%o_\" cat jobid, %o)",
                    coarsefile, finefile, lmfdbfile, N), jobs, jobs:infile:=coarsefile,vkey:="GL2");
    if header then
        header_file := "header_" cat lmfdbfile;
        fp := Open(header_file,"w"); Puts(fp,coljoin([r[1]:r in lmfdb_cols])); Puts(fp,coljoin([r[2]:r in lmfdb_cols])); Puts(fp,""); Flush(fp); delete fp;
        System(Sprintf("rm %o_* %o_*; cat %o %o_* > %o ; rm %o_* %o", coarsefile, finefile, header_file, lmfdbfile, lmfdbfile, lmfdbfile, header_file));
    else
        System(Sprintf("rm %o_* %o_*; cat %o_* > %o ; rm %o_*", coarsefile, finefile, lmfdbfile, lmfdbfile, lmfdbfile));
    end if;
    cnt := atoi(Split(Pipe("wc -l " cat lmfdbfile,"")," ")[1]) - (header select 3 else 0);
    printf "Output %o with %o records of LMFDB data created in %.3os\n", lmfdbfile, cnt, Realtime()-start;
end intrinsic;

intrinsic SL2LMFDBData (coarsefile::MonStgElt, finefile::MonStgElt, lmfdbfile::MonStgElt : header:=true)
